import React from 'react';
import './style.css';
import Card from '../UI/Card';

const Sidebar = (props) => {
    return (
        <div className="sidebarContainer">
        <Card style={{marginBottom:'20px'}}>
            <div className="cardHeader">
                <span>About Us</span>
                <div>
                    <img src="" alt=""/>
                </div>

            </div>
        </Card>

        <Card>
            <div className="cardHeader">
                <span>Social Network</span>

            </div>
        </Card>
        </div>


    )
}

export default Sidebar;
